import React, { Component } from 'react';

import './Blog.css';
import Posts from '../../container/Blog/Posts/Posts';

class Blog extends Component {
    render(){
            //map provides new array
        return(
            <div className='Blog'>
            <header>
                <nav>
                    <ul>
                        <li><a href='/'>Home</a></li>
                        <li><a href='/new-post'>New Post</a></li>
                        <li><a href='/'></a></li>
                        <li><a href='/'></a></li>
                    </ul>
                </nav>
            </header>
            localhost:3000/

            <Posts />
            

            {/* <section>
                <FullPost id={this.state.selectedPostId}/>
            </section>
            <section>
                <NewPost />
            </section> */}
        </div>
        );
    }
}


export default Blog;
